// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC20 {
    function transfer(address recipient, uint256 amount)
        external
        returns (bool);

    function balanceOf(address account) external view returns (uint256);
}

contract RewardDistributor {
    address public admin; // 合约管理员地址

    constructor() {
        admin = msg.sender; // 将部署合约的账户设置为管理员
    }

    // Debug event
    event DebugLog(
        address tokenAddress,
        address to,
        uint256 balance,
        uint256 amount
    );

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function.");
        _;
    }

    function setAdmin(address newAdmin) public onlyAdmin {
        require(newAdmin != address(0), "Invalid address for admin.");
        admin = newAdmin;
    }

    // 定义一个结构体来存储代币地址和数量
    struct ReceiverInfo {
        address tokenAddress; // 代币合约地址
        uint256 amount; // 要分发的代币数量
    }

    // 分发代币给指定的接收者（在这里假设管理员自己是接收者）
    function distribute(ReceiverInfo[] calldata receiverInfos, address to)
        public
        onlyAdmin
    {
        // check all
        for (uint256 i = 0; i < receiverInfos.length; i++) {
            address tokenAddress = receiverInfos[i].tokenAddress;
            uint256 amount = receiverInfos[i].amount;

            require(tokenAddress != address(0), "Invalid token address.");
            require(amount > 0, "Invalid amount.");

            // Check balance
            uint256 balance = balanceOfToken(tokenAddress);

            // Output debug information
            emit DebugLog(tokenAddress, to, balance, amount);
            require(balance >= amount, "Insufficient balance.");
        }

        // send all
        for (uint256 i = 0; i < receiverInfos.length; i++) {
            address tokenAddress = receiverInfos[i].tokenAddress;
            uint256 amount = receiverInfos[i].amount;

            IERC20 token = IERC20(tokenAddress);
            bool sent = token.transfer(to, amount); // Adjust recipient address if needed
            require(
                sent,
                string(
                    abi.encodePacked(
                        "Token transfer failed for token index ",
                        uintToStr(i)
                    )
                )
            );
        }
    }

    // Function to get the balance of an address for a specific token
    function balanceOfToken(address tokenAddress)
        internal
        view
        returns (uint256)
    {
        bytes memory data = abi.encodeWithSelector(
            bytes4(keccak256(bytes("balanceOf(address)"))),
            address(this)
        );
        (bool success, bytes memory result) = tokenAddress.staticcall(data);
        require(success, "External call failed");
        return abi.decode(result, (uint256));
    }

    // 辅助函数：将 uint 转换为字符串
    function uintToStr(uint256 _i) internal pure returns (string memory) {
        if (_i == 0) {
            return "0";
        }
        uint256 j = _i;
        uint256 len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint256 k = len;
        while (_i != 0) {
            k = k - 1;
            uint8 temp = (48 + uint8(_i - (_i / 10) * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }
}

